export const MenuPop = ({ navigation }) => {



  return (
    <View style={{ display:"flex", flex:'1', flexDirection:"row"}} >
      <Image source={require("../Images/Livro1.png")}
              style={{}}/>
      <Image source={require("../Images/Livro2.png")}
              style={{}}/>
      <Image source={require("../Images/Livro3.png")}
              style={{}}/>
    </View>
  );
};



export default MenuPop;
